My code contains 2 models, <strong>User</strong> and <strong>Product</strong>. User has a reference to <strong>Product</strong>. In <strong>User</strong> query when i try to populate <strong>Product</strong>', <strong>null</strong> is returned.<br>
I'm testing it with <strong>postman</strong>, and the result is <strong>null</strong> in <strong>cart</strong>. <br>
I am a beginner and don't understand how to solve the issue.</p>
