  firstName: string;
  lastName: string;
  password: string;
  email: string;
  isAdmin: boolean;
  cart: ProductDocument[];
  resetLink: string;
}

const userSchema = new mongoose.Schema({
  firstName: {
    type: String,
    required: true,
    max: 64,
  },
  lastName: {
    type: String,
    required: true,
    max: 64,
  },
  password: {
    type: String,
    required: true,
    min: 6,
  },
  email: {
    type: String,
    required: true,
    lowercase: true,
    trim: true,
  },
  isAdmin: {
    type: Boolean,
    default: false,
  },
  cart: [
    {
      type: mongoose.Schema.Types.ObjectId,
      ref: 'Products',
    },
  ],
  resetLink: {
    data: String,
    default: '',
  },
})

export default mongoose.model&lt;UserDocument&gt;('Users', userSchema)



</code></pre>
<p>product schema</p>
<pre><code>
import mongoose, { Document } from 'mongoose'

export type ProductDocument = Document &amp; {
  name: string;
  description: string;
  categories: string[];
  variants: string[];
  sizes: number[];
}

const productSchema = new mongoose.Schema({
  name: {
    type: String,
    required: true,
